    [],nt"revision_timestamp": "2016-07-27T23:05:33.769676",nt"name": "annual-report-cooperative-recovery-initiative-big-river-mussel-project-fy2014",nt"isopen":
    false,nt"url": null,nt"notes": "This report documents the progress made
    in FY14 on the establishment of 2-4 new populations of four federally listed mussel
    species (clubshell, orange-foot pimpleback, spectaclecase, and purple cat's paw)
    in, or near, the Ohio River Islands National Wildlife Refuge. Specifically, the
    author reports on progress concerning the following objectives: 1)  For clubshell
    species: Monitor adult survival; Collect broodstock, propagate juveniles and culture
    to taggable (stockable) size; stock cultured juveniles.      2) For purple cat's
    paw: Monitor survival of test juveniles, propagate juveniles and culture to taggable
    size, and collect genetic samples. 3) For orange-foot pimpleback: Propagate juveniles
    and culture to taggable size. 4) For spectaclecase: Collect genetic samples and
    refine propagation techniques; propagate juveniles and culture to taggable size.",nt"license_title":
